import "./App.css";
import { Route, Routes } from "react-router-dom";

import Home from "./components/Home";
import Header from "./components/Header";
import Login from "./pages/Login";


function App() {
  return (
    <div>
      <Header />
      <Routes>
        <Route exact path="/" element={<Home />} />


        <Route path="/login" element={<Login />} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
